<template>
  
  <div>
    
    <div class=" mx-auto flex items-center justify-center my-2">
    <button
      @click="prevPage"
      :disabled="currentpage <= 1"
      class="flex items-center justify-center px-3 h-8    "
    >
    <svg class="w-6 h-6 text-gray-800 " aria-hidden="true" xmlns="http://www.w3.org/2000/svg" width="24" height="24" fill="none" viewBox="0 0 24 24">
  <path stroke="currentColor" stroke-linecap="round" stroke-linejoin="round" stroke-width="2" d="m17 16-4-4 4-4m-6 8-4-4 4-4"/>
</svg>

      
    </button>
    <span class="text-sm text-gray-700 mx-4">
      Page
      <span class="font-semibold text-gray-900">{{ currentpage }}</span>
      Sur
      <span class="font-semibold text-gray-900">{{ totalpages }}</span>
    </span>
    <button
      @click="nextPage"
      :disabled="currentpage >= totalpages"
      class="flex items-center justify-center px-3 h-8 "
    >
     
    <svg class="w-6 h-6 text-gray-800 " aria-hidden="true" xmlns="http://www.w3.org/2000/svg" width="24" height="24" fill="none" viewBox="0 0 24 24">
  <path stroke="currentColor" stroke-linecap="round" stroke-linejoin="round" stroke-width="2" d="m7 16 4-4-4-4m6 8 4-4-4-4"/>
</svg>

    </button>
  </div>
    
      <div class="flex justify-center"><canvas ref="pdfCanvas" class="border border-black border-1" id="the-canvas"></canvas></div>
      <div class="flex justify-center"><button @click="addImageToPdf" class="py-2 px-12 bg-yellow-500 text-black my-8 text-lg">Signer</button></div>
     
    
    </div>
</template>
<script>

import { PDFDocument, rgb, scale, StandardFonts } from "pdf-lib"; 
import { saveAs } from "file-saver";
import * as pdfjsLib from "pdfjs-dist/legacy/build/pdf";
import pdfWorker from "pdfjs-dist/legacy/build/pdf.worker?url";
pdfjsLib.GlobalWorkerOptions.workerSrc = pdfWorker;
import logoImage from '../assets/Capture_d_Ã©cran_2025-03-04_234513-removebg-preview.png'; 
export default {
  name: "viewDocument",
  data() {
    return {
      id: "",
      pdfBase64: "",
      imageBase64: "",
      canvas:null,
      scale:1.0,
      pdfdata:null,
      currentpage:1,
      totalpages:1,
      ctx: null,
      pdf:null,
      reference:false,
      date:null,

      positions: [
        
        { pageNumber: 0, x:315.73 , y:559.01}
      ],

    };
  },
  mounted(){
    this.id=this.$route.params.id;
    this.canvas = this.$refs.pdfCanvas;
    this.ctx = this.canvas.getContext("2d");
    this.loadPdf ();
  },
  methods: {
    async loadPdf (){
      try{
        this.reference=true;
        const pdfdata= await atob(this.pdfBase64);
      
      const pdf=await pdfjsLib.getDocument({data:pdfdata}).promise;
      this.totalpages=pdf.numPages;
      await this.renderpage(pdf,this.currentpage);
      }catch (error) {
        console.error("Error loading PDF:", error);
      }


    },
    async renderpage(pdf,pagenum){
      try{
       const page= await pdf.getPage(pagenum);
       if(!page){
        console.log("page n'est pas dispo ");

       }
       const viewport =await page.getViewport({scale:this.scale});
       this.canvas.height=viewport.height;
       this.canvas.width=viewport.width;
       const renderContext={
        canvasContext:this.ctx,
        viewport:viewport,
       }
      await  page.render(renderContext).promise;


      }catch(error){
        console.log(" page render erreur "+error);
      }
    },
    async prevPage() {
      this.currentpage--;
      const pdfdata= await atob(this.pdfBase64);
      
      const pdf=await pdfjsLib.getDocument({data:pdfdata}).promise;
      this.renderpage(pdf, this.currentpage);
    },
    async nextPage() {
      this.currentpage++;
      const pdfdata= await atob(this.pdfBase64);
     
      const pdf=await pdfjsLib.getDocument({data:pdfdata}).promise;
      this.renderpage(pdf, this.currentpage);
    },

    async addImageToPdf() {
      try {
        const pdfBlob = await fetch(`data:application/pdf;base64,${this.pdfBase64}`).then(res => res.blob());
        console.log("pdfblob ramez"+pdfBlob.arrayBuffer())
        const pdfBytes = new Uint8Array(await pdfBlob.arrayBuffer());
        //.log("pdfbytes Ramez"+pdfBytes);
        //const pdfbin = atob(this.pdfBase64);
//const pdfBytes = new Uint8Array(pdfbin.length);
const pdfDoc = await PDFDocument.load(pdfBytes); //pdf document utilise seulement un tableau d'octets 
       
        console.log("PDF chargÃ© avec succÃ¨s.");

        const imageBlob = await fetch(`data:image/png;base64,${this.imageBase64}`).then(res => res.blob());
        const imageBytes = new Uint8Array(await imageBlob.arrayBuffer());
        const img = await pdfDoc.embedPng(imageBytes);
        const imageByttes = await fetch(logoImage).then(res => res.arrayBuffer());
        const image = await pdfDoc.embedPng(imageByttes);

       
        const font = await pdfDoc.embedFont(StandardFonts.Helvetica);

        const pages = pdfDoc.getPages();
        
        for (const pos of this.positions) {
          const page = pages[pos.pageNumber];
          const { width, height } = page.getSize();

          const imgWidth = width / 8; 
          const imgHeight = height / 10;

          const positionX = pos.x -20+(imgWidth +100)/2;
          const positionY = pos.y  ;
          page.drawImage(image, {
            x: pos.x/0.75,
            y: pos.y/0.75,
            width: imgWidth+20,
            height: imgHeight,
          });
          page.drawImage(img, {
            x: positionX/0.75,
            y: positionY/0.75,
            width: imgWidth,
            height: imgHeight,
          });
            this.date=new Date();
            const day= this.date.getDate();
            const mounth=this.date.getMonth()+1;
            const year=this.date.getFullYear();
          
          page.drawText(` Ramez Hadhri le ${day}-${mounth}-${year}  ` ,{
            x: pos.x /0.75 , 
            y: (pos.y + imgHeight-20)/0.75 , 
            size: 12,
            font,
            color: rgb(0, 0, 0), 
          });

          console.log("Image et texte ajoutÃ©s avec succÃ¨s.");
        }

        const modifiedPdfBytes = await pdfDoc.save();
        const blob = new Blob([modifiedPdfBytes], { type: "application/pdf" });
        saveAs(blob, "modified.pdf");
        console.log("PDF tÃ©lÃ©chargÃ© avec succÃ¨s.");
      } catch (error) {
        console.error("Erreur lors de la modification du PDF :", error.message);
      }
    },
  },
};

</script>
